import logo from './logo.svg';
import './App.css';

import NestedModal from './components/popup.js';
import SignUp from './components/SignUp.js';
import StickyFooter from './components/footer.js';
import PrimarySearchAppBar from './components/header.js';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import LogIn from './components/Login.js';
import MyButton from './useless/clickehero.js';
import { bgcolor } from '@mui/system';




function App() {
  return (
    <div className="App">
      <div className='App-body' >
      <BrowserRouter>
        <Routes>
          <div style={{backgroundImage:'url('}}>
            <Route path='/' element={<MyButton />}></Route>
          </div>
        <Route path='/login/' element={<LogIn />}></Route>
        <Route path='/sign/' element={<SignUp />}></Route>
        </Routes>
      </BrowserRouter>


      </div>
      <header className='App-header'>
      <PrimarySearchAppBar />
      <img src={logo} className="App-logo" alt="logo" />
      </header>

      <footer className='App-footer'>
        <StickyFooter />
      </footer>

    </div>

  );
}

export default App;
